  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115001 includes chemical,
  discrete sample, physical, profile and underway - surface data collected from METEOR
  in the North Atlantic Ocean from 1991-09-02 to 1991-09-26 and retrieved during cruise
  06MT18_1 and WOCE_A01E. These data include ALKALINITY, CARBON DIOXIDE - AIR, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
  PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide, Potential temperature
  (theta), SALINITY, SEA SURFACE TEMPERATURE, SILICATE, Tritium (Hydrogen isotope)
  and WATER TEMPERATURE. The instruments used to collect these data include CTD, Carbon
  dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous carbon
  dioxide (CO2) measurement and bottle. These data were collected by Douglas Wallace
  of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich Marine Biogeochemie
  and Kenneth Johnson [affiliation unknown] as part of the WOCE A1E and WOCE_A01E
  data set.nnThe World Ocean Circulation Experiment (WOCE) was a major component of
  the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
